document.addEventListener('DOMContentLoaded', function() {
/* Add Code Here */

});


function onAddBtnClicked() {
    let todoDiv = document.querySelector('#todoList');
    let todoItem = document.createElement('div');
    todoItem.className = 'todoItem';
    let itemContent = document.createElement('div');
    itemContent.innerText = document.querySelector('#input').value;
    itemContent.className = 'itemContent';
    let itemBtn = document.createElement('button');
    itemBtn.innerText = 'Delete';
    itemBtn.onclick = (ev) => onItemDelBtnClicked(ev);
    itemBtn.className = 'deleteBtn';
    todoItem.appendChild(itemContent);
    todoItem.appendChild(itemBtn);
    todoDiv.appendChild(todoItem);
}

function onItemDelBtnClicked(ev) {
    let parentItem = ev.target.parentElement;
    parentItem.remove();
}

